import { overVehicles } from "../../constants";

const Ow_Cars = () => {
    return (
        <>
            {overVehicles.map((car) => {
                return (
                    <section>
                        <div className="grid gap-y-12">
                            <h2>{car.model}</h2>
                        </div>
                    </section>
                )
            })}
        </>
    );
};

export default Ow_Cars;
